import React from 'react';
import { Dialog, DialogTitle, DialogContent, DialogContentText, DialogActions, Button, List, ListItem, ListItemIcon, ListItemText, Typography } from '@mui/material';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';

function HealthRecommendationsDialog({ open, handleClose, recommendations, healthScore, bmi }) {
    return (
        <Dialog open={open} onClose={handleClose} maxWidth="sm" fullWidth>
            <DialogTitle style={{ textAlign: 'center', fontWeight: 'bold', color: '#007bff' }}>
                Health Recommendations
            </DialogTitle>
            <DialogContent>
                <DialogContentText style={{ marginBottom: '20px', textAlign: 'center', color: '#555' }}>
                    Based on your health assessment, here are some recommendations:
                </DialogContentText>
                
                {/* Health Score and BMI */}
                <List>
                    <ListItem>
                        <ListItemText
                            primary={
                                <Typography variant="body1" style={{ fontWeight: 'bold', color: '#333', fontSize: '16px' }}>
                                    Your Health Score is {healthScore}.
                                </Typography>
                            }
                        />
                    </ListItem>
                    <ListItem>
                        <ListItemText
                            primary={
                                <Typography variant="body1" style={{ fontWeight: 'bold', color: '#333', fontSize: '16px' }}>
                                    Your BMI is {bmi}.
                                </Typography>
                            }
                        />
                    </ListItem>
                </List>

                {/* Recommendations */}
                <List>
                    {recommendations.map((rec, index) => (
                        <ListItem key={index} alignItems="flex-start">
                            <ListItemIcon>
                                <CheckCircleIcon style={{ color: '#4caf50' }} />
                            </ListItemIcon>
                            <ListItemText>
                                <Typography variant="body1" style={{ color: '#333', fontSize: '16px' }}>
                                    {rec}
                                </Typography>
                            </ListItemText>
                        </ListItem>
                    ))}
                </List>
            </DialogContent>
            <DialogActions style={{ justifyContent: 'center' }}>
                <Button onClick={handleClose} variant="contained" color="primary" size="large" style={{ padding: '10px 20px', fontWeight: 'bold' }}>
                    Close
                </Button>
            </DialogActions>
        </Dialog>
    );
}

export default HealthRecommendationsDialog;
